css:
@font-face {
  font-family: 'symbol-icons';
  src: url('atom://atom-typescript/images/symbol-icons.woff') format('woff');
  font-weight: normal;
  font-style: normal;
}
.atomts-semantic-view {
  max-width: 250px;
  max-height: 100%;
  overflow-y: auto;
  padding: 10px;
}
.atomts-semantic-view .selected {
  background: #31363f;
}
.atomts-semantic-view .node {
  cursor: pointer;
}
.atomts-semantic-view .icon-class::before {
  font-family: 'symbol-icons';
  content: '\e600';
}
.atomts-semantic-view .icon-struct::before {
  font-family: 'symbol-icons';
  content: '\e601';
}
.atomts-semantic-view .icon-variable::before {
  font-family: 'symbol-icons';
  content: '\e607';
}
.atomts-semantic-view .icon-field::before {
  font-family: 'symbol-icons';
  content: '\e607';
}
.atomts-semantic-view .icon-member::before {
  font-family: 'symbol-icons';
  content: '\e607';
}
.atomts-semantic-view .icon-interface::before {
